import React, { Component } from 'react';
//import GetHomeService from '../../services/GetHomeService.js';
import axios from 'axios';

class Homes extends Component {

    constructor(props) {

        super(props);
        //   let homes = GetHomeService.getHomes('http://localhost:8080/homes');
        this.state = {
            todos:
                [
                    { id: 1, description: 'Learn to Dance', done: false, targetDate: new Date() },
                    { id: 2, description: 'Become an Expert at React', done: false, targetDate: new Date() },
                    { id: 3, description: 'Visit India', done: false, targetDate: new Date() }
                ],
            homelist: [{  id: 1, description: 'Learn to Dance', done: false, targetDate: new Date() }],
            status: -1
        }


    }


    render() {
        // console.log(this.state.homelist)
       // this.setState({ homelist: this.hanldeSuccessCall })
        return (
            <>
                <ShowHomes status={this.state.status} homelist={this.state.todos}></ShowHomes>
                <div className="container bg-light">
                    <button onClick={this.hanldeSuccessCall}></button>
                </div>
            </>);


    } 
    // .then( {
    //     // handle success
    //     console.log(response.data);
    //     return response.data;
       
    // })
    // .catch(function (error) {
    //     console.log(error);
    // })

    hanldeSuccessCall = () => {

       axios.get('http://localhost:8080/homes').then( function (response) 
            {
                let data= response.data;
               this.setState({ homelist: data })
            }
          );
        this.setState({ status: 1 })
       
        console.log("Logging state homelist")
        console.log(this.state.homelist)
      //  return homes;
    }



}


function ShowHomes(props) {

    if (props.status === 1) {
        console.log(props.homelist);
        return (
           
            <div className="container bg-light">
                <table className='table table-striped'>
                    <thead className='thead-dark'>
                        <tr>
                            <th>Description</th>
                            <th>Completed</th>
                            <th>Due Date</th></tr>
                    </thead>
                    <tbody>
                     {
                            props.homelist.map(
                                home =>
                                    <tr key={home.homeId}>
                                        <td>{home.name}</td>
                                        <td>{home.url.toString()}</td>
                                        <td>{home.phone.toString()}</td>
                                    </tr>
                            )
                        } 

                    </tbody>

                </table>
            </div>
        )
    }
    else {
        return null;
    }
}



export default Homes;
